$(document).ready(function(){"use strict";var e;$(".delete-button").click(function(t){t.preventDefault(),e=$(this).data("id"),$.magnificPopup.open({items:{src:"#delete-confirm-modal"},type:"inline"})}),$(".modal-confirm").click(function(){$.ajax({url:baseUrl+"/admin/media/"+e,type:"DELETE",headers:{"X-CSRF-TOKEN":$("#csrf-token").attr("content")},success:function(){location.href=baseUrl+"/admin/media/grid"},error:function(e){new PNotify({title:"Error",text:401==e.status?e.responseText:"Error found while database operation.",type:"error",addclass:"notification-error",icon:"fas fa-times"})}})}),$(".modal-dismiss").click(function(){$.magnificPopup.close()})});